import { Helmet } from 'react-helmet';

export default function Profil() {
    return (
        <div className="App">

            <Helmet>
                <style>{'body { background-color: black; }'}</style>
            </Helmet>

            <Card mt={42}>
                <Button variant="contained" sx={{ fontWeight: 'bold',fontSize: 'h8.fontSize' }}>
                    profil
                </Button>
            </Card>

        </div>
        );
    }
